-- ----------------------------
BEGIN;
INSERT INTO `ai_scale` VALUES (2, '简易智能精神状态量表', NULL, NULL), (5, '阿尔茨海默病评定量表', '        阿尔茨海默病评定量表（Alzheimer\'s disease assessment scale-cognitive section,ADAS）由Rosen等在1984年编制，适用于轻、中度痴呆检测，在药物临床实验中被广泛用于认知变化的评价。不适合极轻和极重度痴呆的评定，也不能用于痴呆病因的鉴别诊断。ADAS分为认知（ADAS-Cog）和非认知（ADAS-Non-Cog）两个部分。该检查内容较为详细，包含了痴呆诊断标准所要求的主要认知功能测定，整个操作必须由专业人员执行，需时约45分钟。&ADAS的认知部分常单独使用，目的是评定阿尔茨海默病患者记忆力、语言和其他认知障碍的严重程度，由12个条目组成。其中，4个条目评价记忆力（单词回忆和单词辨认）和定向力（时间和地点），5个条目评价语言（命名物体或手指、指令、口头语言能力、找词困难和口头语言理解能力），2个条目评价实践能力（结构性练习和意象性练习），1个条目评价注意力和注意力集中（回忆测验指令）。', 'ADAS认知部分的检测方法：ADAS认知部分的测验部分条目应该按照评分表所列的次序进行测验。首先进行单词会议测试，单词辨认测验最后进行，其它认知条目穿插与两项测试之间。以这种方式将两项单词记忆任务分开，可以最大限度地减小患者混淆两项任务中的单词的机会。开始测试之前，测试者应该与患者进行一些简短交谈，谈论一些中性话题，如天气、患者到诊所的路途，或患者的早餐等，这可使患者更放松，也为测试这提供了一个观察患者应用和理解语言能力的机会。&ADAS不是一项定时测验，患者的评分不依赖测验完成的速度有多快。为了确保测试阶段快速进行，确保每位患者有同样的机会正确回答，每个认知条目只允许有两次回答机会。如果患者在第二次机会中未能正确回答，测试者应该进行下一次条目。给患者的反馈应该是中性的，并且，通常不能提示其回答是否正确。只要患者在努力，可作诸如“很好”或“做的不错”等评论。如果患者特别询问自己是否回答正确，则可给予反馈。'), (11, '画钟测验', '画钟测验（clock drawing teset，CDT）常用于筛查视空间知觉和视结构的功能障碍；还可以反映语言理解、短时记忆、数字理解、执行能力，对顶叶和额叶损害敏感。常用的施测和评分方法是：①要求被试模仿已画好的钟，反映视空间知觉能力；②要求被试自己画一个钟，评估执行能力。CDT在门诊非常实用，受文化背景、教育程度影响小。但是单独应用它进行痴呆筛查时效度偏低，常与MMSE联合使用。&画钟试验得分与MMSE的相关性在0.82-0.85左右，能区分83%的痴呆被试，并能区分92%伴和不伴结构损害的痴呆被试。Brodaty和Moore在1997年研究发现，在28年AD中只有20MMSE得分低于24分，但通过画钟测验则发现24名被试有认知功能缺损。这项研究结果显示画钟测验从正常人中检出AD的敏感性是86%，特异性是96%。', NULL), (12, 'Rey听觉词语学习测验', 'Rey听觉词语学习测验（Rey auditory verbal learning test ,RAVLT）是Rey于1964年编制的，主要用于评价被试的记忆力。在长期应用过程中，RAVLT演变出很多版本，不同的版本在学习回忆的次数、词语的常见性、是否进行再认等方面存在不同。应用最多的是对15个名词（A组）连续进行5次学习和回忆后，对另外15个“干扰”名词（B组）进行学习回忆，并在30分钟后回忆第一组词语。前5次正确回忆的总数为即刻记忆得分，用于评价即刻记忆,大于15分为正常。30分钟后正确回忆的总数为延迟记忆得分，用于评价延迟记忆>4分为正常。此外，还有的研究者为避免天花板效应选择3次学习，或在长时过程回忆后进行再次测验。再认的方式有两种，一种是让被试在50个名词（包括15个A组词，15个B组词和20个新的常见名词）中识别出A组词；另一种是让被试在包含所有A组词的一则故事中，识别出A组词。英文版测验显示RAVLT鉴别AD和血管性痴呆的灵敏性为81%，特异性为84%。', NULL), (13, '数字广度测验', '数字广度测验(digit span test，DST)是韦氏成人智力量表的一部分，主要用于评价被试的注意力和即刻记忆。测验分为顺背和倒背两部分，要求被试按照顺序或者倒序复述数字，分别记录正确的数目，总分=顺背数字正确数+倒背数字正确数。DST总分受教育程度影响，文盲组>5分属于正常，小学文化程度>6分属于正常，初中及以上文化程度>7分属于正常。', NULL), (14, '符号数字转换测验', '符号数字转换测验（symbol digit modalities test，SDMT）是Smith于1968年编制的，主要用于评估被试的注意力，还可以反映工作记忆、视知觉能力、信息加工速度、运动速度等，对额叶和顶叶损害敏感。测试要求被试按照页面上方的图解，在下方表格的每个符号下方，以最快的速度填入与之相配对的数字，在90秒内正确填写的数字个数为最后得分。Sheridan等以社区人群为研究对象的一项研究显示，SDMT得分不受年龄、教育程度、性别和收入影响。SDMT具有操作简单、易于实施、耗时短等优点，有笔试版和口试版两种版本，两种版本相关性为0.8，口试版可以用于不能书写的被试及功能磁共振（functional MRI，fMRI）研究。Sheridan等针对社区人群研究发现，在55岁以上的老年人中，笔试版正确数>21个为正常，口试版正确数>30为正常。此外介绍的是笔试版，它是在临床上常用的认知功能筛查工具，完成测试仅需时约2分钟。&SDMT与韦氏成人智力量表中的数字符号测验（Wechsler adult intelligence acale-revised version of digit symbol，WAIS-R DS）相似，Morgan等研究发现，两者相关性为0.85，SDMT的得分平均较WAIS-R DS 低2.5～3分。虽然相关性较高，但两者的得分不可直接互换，其中SDMT的敏感性更高。&SDMT已广泛用于各种神经疾病患者的认知功能评估之中，例如它对多发性硬化（multiple sclerosis，MS）患者认知功能损害的敏感性高，其得分与MS患者的脑萎缩、N-乙酰天冬氨酸水平以及脑室扩大等高度相关。', '开始测试前需要准备好秒表。'), (15, 'Stroop色词测验', 'Stroop色词测验（Stroop color-word test,CWT)是Stroop教授于1935年编制的，主要用于评价被试的执行功能，对额叶损害敏感。Stroop色词测验与连线测验、词语流畅性测验相关。测验共分为三个部分，即词语任务、颜色任务、色词任务三部分，分别要求被试准确并快速的按要求读出词语或颜色。评价指标包括完成每张卡片的耗时、正确阅读数之差表示。在长期的应用过程中，Stroop色词测验演变出不同的版本，测验者可通过增加卡片张数、每张卡片数字和颜色种类数增加测验的复杂性和难度，此处介绍的是应用最多的中等难度版本，包括3张卡片每张卡片各50个字，共4总颜色。有研究显示脑损伤患者在色词任务中分辨绿色、蓝色的错误率较红色、黄色有增高趋势。中文版Stroop色词测验识别轻度AD的敏感性为80.4%，特异性为86.2%。', '进行测试前必须派出文盲、色盲和色弱者。'), (19, '词语流畅性测验', '词语流畅性测验（verbal fluency test，VFT）是由Thurstone等于1962年首次提出应用于痴呆临床诊断的，用于检测优势半球额叶及颞叶的功能，主要评价被试的语言能力、语义记忆和执行功能等。测验要求被试在规定时间内尽可能多地说出某一类词语。可分为语义流畅性、语音流畅性和动作流畅性，其中语义流畅性测验又称快速词汇分类测验（rapid verbal retrieve，RVR），是目前我国应用最多的语言流畅性测验。英文原版测验显示AD患者在语义流畅性中的损害最为明显，而中文版测验显示语音流畅性得分较语义流畅性低，且受教育程度影响大，在低教育水平组（文盲～初中）中应用时灵敏度不高，可在教育程度较高（高中以上）组中结合语义流畅性应用，增加测验的灵敏度。VFT测试方法简单易行、耗时短，便于在门诊进行。与Boston命名、连线测验等比较均呈现较好的相关性，其诊断阿尔茨海默病的敏感性为51.5%～84.3%，特异性为83.9%～93.8%。史丽丽等通过研究确定了中文版语义流畅性测验在不同教育程度人群中分界值，其中文盲为16分，小学为17分，初中为22分，高中为21分，高中以上为28分。其灵敏度、特异度在文盲中为51.43%和92.43%，小学为54.76%和92.49%，初中为66.67%和90.97%，高中为67.74%和91.71%，高中以上为84.31%和90.43%。', NULL), (20, '连线测验', '连线测验（trail making test,TMT）是由Partington于1938年编制的，用于评价被试的注意力、视空间能力和执行功能，是目前最常用的神经心理测验之一，广泛应用于认知障碍的筛查和诊断。分为A、B两部分，A部分要求被试按顺序以最快速度连接随机排列的25个数字，B部分要求被试按交替的顺序以最快速度连接13个数字和12个汉字，每部分正式测验前均有练习，测验时需记录完成时间，作为测验的分。有学者认为，A部分和B部分对两侧大脑半球损害的敏感性不同，A部分对右侧敏感，而B部分对左侧敏感，如B部分得分小于A部分2倍，提示被试为右侧大脑半球受损，反之，如B部分得分大于A部分的3倍，则提示被试为左侧大脑半球受损。测试时间约为10分钟。Ashendorf等研究发现连线测验得分于年龄及教育程度有关，并确定了不同年龄及教育人群临界值：①55至74岁，教育程度<16年为A部分154秒；②75至98岁，教育程度<16年为A部分78秒，B部分为205秒；③55至74岁，教育程度≥16年为A部分48秒，B部分106秒；④75岁至98岁，教育程度≥16年为A部分80，B部分192秒。&Reynolds等于2002年根据原版测验编制了综合版连线测验（comprehensive trail making test,CTMT），以弥补原版测验过于简单和特异性低等不足。CTMT共分为5个部分，测验中增加了形状等连线条件，使其更为复杂。对被试的注意力和视空间能力要求更高，该测验目前尚无中文版本。', '测试按照A部分练习→A部分测试→B部分练习→B部分测试的顺序进行。&首先将A部分练习表放在被试面前，然后说：“这一页上有一些数字（指着数字）。请您从数字1开始（指着1），按照1到2（指着2）、2到3（指着3）、3到4（指着4），以此类推，从小到大的顺序连线，直至到达终点（指着终点）。请您以最快速度连线。准备，开始。”如果被试正确完成了练习，则进行A部分测试。如果被试在A部分练习时出错，应立即指出错误并加以解释。如果被试不能完成A部分练习，就握着他或她的手，引导被试从头到尾尝试一次。然后再让被试独自尝试。必要时可重复进行解释或尝试，直到被试能够成功完成练习，或也可发现被试显然不能完成任务。'), (30, '蒙特利尔认知评估量表（MoCA）', NULL, NULL), (31, '临床疗效总评量表(CGI)', NULL, NULL), (32, '缺血指数量表（HIS）', NULL, NULL), (33, '日常生活能力量表(ADL)', NULL, NULL), (34, '神经精神科问卷（NPI）', NULL, NULL), (35, '汉密顿抑郁量表(HAMD)', NULL, NULL), (36, '老年抑郁量表（GDS）', NULL, NULL), (37, '汉密尔顿焦虑量表(HAMA)', NULL, NULL), (38, '总体衰退量表', NULL, NULL), (39, '幸福指数自评量表', NULL, NULL), (41, '康奈尔痴呆抑郁量表', NULL, NULL), (42, '简易智力检测量表AMTS', NULL, NULL);
COMMIT;

-- ----------------------------
-- Table structure for ai_test
-- ----------------------------
DROP TABLE IF EXISTS `ai_test`;
CREATE TABLE `ai_test`  (
  `ai_scale_id` int(11) NOT NULL,
  `ai_question_id` int(11) NOT NULL,
  `ai_question_content` varchar(8000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_question_option` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_question_answer` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_question_img` mediumblob NULL,
  `ai_question_type` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_question_score` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_question_notice` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_question_guid` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_question_answer_describe` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_score_method_name` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `ai_score_method` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ai_scale_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
